import React from 'react';

const Note = (props) => {
  const deleteNote = () =>{
    props.deleteItem(props.id);
  };
  return (
    <>
        <div className='noteBox'>
            <h1>{props.title}</h1>
            <br />
            <p>{props.content}</p>
            <button className='Delete' onClick={deleteNote}>Delete</button>
        </div>
    </>
  );
};

export default Note;
